				["init"] = {
					["custom"] = "LWA = LWA or {}\n\n-- Inspired by Aerx Square Runes (Rune Grace)\nfunction LWA.RuneGrace(allstates, event, runeId, ...)\n    if runeId == nil then return false end\n    local duration = 2.47\n    \n    if not allstates[\"\"] then\n        local _, _, runeReady = GetRuneCooldown(runeId)\n        \n        allstates[\"\"] = {\n            show = true,\n            changed = true,\n            nonCombatTime = GetTime()-1,\n            RuneReady = runeReady,\n            RuneGrace = false,\n            duration = duration,\n            expirationTime = 0,\n            progressType = \"timed\"\n        }\n    end\n    \n    if \"RUNE_POWER_UPDATE\" == event or \"RUNE_TYPE_UPDATE\" == event then\n        local _, _, runeReady = GetRuneCooldown(runeId)\n        \n        allstates[\"\"].changed = true\n        allstates[\"\"].RuneReady = runeReady\n        \n        if runeReady then\n            if allstates[\"\"].RuneGrace then\n                allstates[\"\"].expirationTime = GetTime() + duration\n                C_Timer.After(duration, function() WeakAuras.ScanEvents(\"LWA_RUNE_GRACE\", runeId) end)\n            end\n        elseif InCombatLockdown() then\n            allstates[\"\"].RuneGrace = true\n        else\n            allstates[\"\"].nonCombatTime = GetTime()\n            allstates[\"\"].RuneGrace = false\n            allstates[\"\"].expirationTime = 0\n        end\n    elseif event == \"LWA_RUNE_GRACE\" then\n        if allstates[\"\"].RuneReady then\n            allstates[\"\"].changed = true\n            allstates[\"\"].RuneGrace = false\n            allstates[\"\"].expirationTime = 0\n        end\n    elseif event == \"PLAYER_REGEN_DISABLED\" then\n        if allstates[\"\"].nonCombatTime == GetTime() then\n            allstates[\"\"].changed = true\n            allstates[\"\"].RuneGrace = true\n        end\n    elseif event == \"PLAYER_REGEN_ENABLED\" then\n        allstates[\"\"].changed = true\n        allstates[\"\"].RuneGrace = false\n        allstates[\"\"].expirationTime = 0\n    end\n    \n    return true\nend",
