						["remaining"] = "6",
						["events"] = "RUNE_TYPE_UPDATE RUNE_POWER_UPDATE FRAME_UPDATE PLAYER_REGEN_DISABLED PLAYER_REGEN_ENABLED ",
						["custom"] = "function(allstates, event, rune)\n    if event == \"RUNE_POWER_UPDATE\" \n    or event == \"RUNE_TYPE_UPDATE\"\n    then\n        if not rune then \n            for i = 1, 6 do \n                aura_env.updateRune(allstates, i)\n            end\n        else\n            aura_env.updateRune(allstates, rune)\n        end\n        return true\n    elseif event == \"OPTIONS\" then\n        for i = 1, 6 do \n            aura_env.updateRune(allstates, i)\n        end\n    elseif event == \"PLAYER_REGEN_ENABLED\" then\n        for i = 1, 6 do\n            local state = allstates[i]\n            state.overTimeStart = 0\n            state.overTimeRem = 0\n            state.additionalProgress[1].min = 0\n            state.additionalProgress[1].max = 0\n            state.runeReady = false          \n            state.changed = true\n            state.hasGrace = false\n        end\n        aura_env.spentInCombat = {\n            false, false, false, false, false, false,   \n        }\n        return true\n    elseif event == \"PLAYER_REGEN_DISABLED\" then\n        for i = 1, 6 do \n            local start, duration, runeReady = GetRuneCooldown(i)\n            if runeReady then\n                aura_env.spentInCombat[i] = \"fresh\"\n            end\n        end\n    elseif InCombatLockdown() then\n        local update = false\n        for key, state in pairs(allstates) do\n            if state.runeReady and state.hasGrace then\n                local exp = state.overTimeStart\n                local rem = exp - GetTime()\n                if rem > 0 then\n                    state.additionalProgress[1].min = rem + 7.529999999988\n                    state.additionalProgress[1].max = 10\n                    state.overTimeRem = 2.471 - rem\n                    state.changed = true\n                    update = true\n                end\n            elseif state.additionalProgress[1].min ~= 0 or state.additionalProgress[1].max ~= 0 then\n                state.additionalProgress[1].min = 0\n                state.additionalProgress[1].max = 0\n                state.changed = true\n                update = true\n            end\n        end\n        return update\n    end\nend",
